import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { List, ListItem, IconButton, Button, TextField } from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';

const TradeList = () => {
  const [trades, setTrades] = useState([]);
  const [newTrade, setNewTrade] = useState({ asset: '', price: '', quantity: '' });

  useEffect(() => {
    fetchTrades();
  }, []);

  const fetchTrades = async () => {
    try {
      const response = await axios.get('/api/trades');
      setTrades(response.data);
    } catch (error) {
      console.error('Error fetching trades:', error);
    }
  };

  const addTrade = async () => {
    try {
      const response = await axios.post('/api/trades', newTrade);
      setTrades([...trades, response.data]);
      setNewTrade({ asset: '', price: '', quantity: '' });
    } catch (error) {
      console.error('Error adding trade:', error);
    }
  };

  const removeTrade = async (id) => {
    try {
      await axios.delete(`/api/trades/${id}`);
      setTrades(trades.filter(trade => trade._id !== id));
    } catch (error) {
      console.error('Error removing trade:', error);
    }
  };

  return (
    <div>
      <h2>Trade List</h2>
      <div>
        <TextField
          label="Asset"
          value={newTrade.asset}
          onChange={(e) => setNewTrade({ ...newTrade, asset: e.target.value })}
        />
        <TextField
          label="Price"
          value={newTrade.price}
          onChange={(e) => setNewTrade({ ...newTrade, price: e.target.value })}
        />
        <TextField
          label="Quantity"
          value={newTrade.quantity}
          onChange={(e) => setNewTrade({ ...newTrade, quantity: e.target.value })}
        />
        <Button onClick={addTrade}>Add Trade</Button>
      </div>
      <List>
        {trades.map((trade) => (
          <ListItem key={trade._id}>
            {trade.asset} - {trade.price} - {trade.quantity}
            <IconButton onClick={() => removeTrade(trade._id)}>
              <DeleteIcon />
            </IconButton>
          </ListItem>
        ))}
      </List>
    </div>
  );
};

export default TradeList;
